import React, { useState } from "react";
import './Styles/App.css'
import Block from "./Components/block";

function App() {
  const [counter, setCounter] = useState(0);
  function increment(){
    setCounter(counter+1)
  }
  return (
    <div className="App">
      {counter}
      <Block func={increment}/>
    </div>
  );
}

export default App;
